import React from 'react'
import { Link } from 'react-router-dom'
const MyComponent = () => {
    // Accessing the current URL
    const currentUrl = window.location.href;

    return (
        <div>
            <h2>Current URL: {currentUrl}</h2>
            {/* Your component JSX */}
        </div>
    );
};

function Header() {
    return (
        <>
            <nav nav class="navbar navbar-expand-lg bg-white navbar-light shadow sticky-top p-0" >
                <a href="index.html" class="navbar-brand d-flex align-items-center px-4 px-lg-5">
                    <h2 class="m-0 text-primary"><i class="fa fa-book me-3"></i>SuperSeminar</h2>
                </a>
                <button type="button" class="navbar-toggler me-4" data-bs-toggle="collapse" data-bs-target="#navbarCollapse">
                    <span class="navbar-toggler-icon"></span>
                </button>
                <div class="collapse navbar-collapse" id="navbarCollapse">
                    <div class="navbar-nav ms-auto p-4 p-lg-0">
                        <Link id='home' to="/" class="nav-item nav-link ">Home</Link>
                        <Link id='about' to="/about" class="nav-item nav-link">About</Link>
                        <Link id='contact' to="/contact" class="nav-item nav-link">Contact</Link>
                        <Link id='workshops' to="/seminars" class="nav-item nav-link">Seminars</Link>
                        {/* <div class="nav-item dropdown">
                            <a href="#" class="nav-link dropdown-toggle" data-bs-toggle="dropdown">Pages</a>
                            <div class="dropdown-menu fade-down m-0">
                                <a href="team.html" class="dropdown-item">Our Team</a>
                                <a href="testimonial.html" class="dropdown-item">Testimonial</a>
                                <a href="404.html" class="dropdown-item">404 Page</a>
                            </div>
                        </div> */}
                    </div>
                    <Link to="/logister" class="btn btn-primary py-4 px-lg-5 d-none d-lg-block">Login/Register
                        <i class="fa fa-arrow-right ms-3"></i></Link>
                </div>
            </nav >
        </>

    )
}

export default Header
